import React from "react";
import Announcement from "../Annoucement/Annoucement";
import Footer from "../Footer/Footer";
import Navbar from "../Navbar/Navbar";

const About = () => {
  return <div>
    

    <Announcement/>
        <Navbar/>
        <h1>About</h1>
        <footer>
          <Footer />
        </footer>
  </div>;
};

export default About;
